function addChordG(b,a){addChord(b,"G",0,function(c){addOpenString(c,["G","D"]);addFretPress(c,3,["LowE","H","HighE"]);addFretPress(c,2,"A")},a)}function addChordGv2(b,a){addChord(b,"G",0,function(c){addOpenString(c,["G","D","H"]);addFretPress(c,3,["LowE","HighE"]);addFretPress(c,2,"A")},a)}function addChordG_H(b,a){addChord(b,"G/H",0,function(c){addMute(c,["LowE","HighE"]);addOpenString(c,["G","D","H"]);addFretPress(c,2,"A")},a)}function addChordGm(b,a){addChord(b,"Gm",3,function(c){addBarre(c,1,"LowE","HighE");addFretPress(c,3,["A","D"])},a)}function addChordGis(b,a){addChord(b,"G#",4,function(c){addBarre(c,1,"LowE","HighE");addFretPress(c,2,"G");addFretPress(c,3,["A","D"])},a)};